  return (
    <div className='cards'>
      {props.ciudad.map(c => (
        <Card
          key={c.id}
          name={c.name}
          min={c.min}
          max={c.max}
          img={c.img}
          onClose={() => onClose(c.id)}
        />
      ))}
    </div>
  );
}
